                    <h1 class=""post-title"">Singha Vừa Rót 650 Triệu USD Đầu Riên Vào Masan</h1>
                    <div class=""post-thumb""><img src=""images/detail-thumb.jpg"" alt=""""></div>
                    <p>Theo thông báo ngày hôm nay (28/1), đối tác chiến lược của Công ty cổ phần Tập đoàn Masan là Singha Asia Holding Pte Ltd (“Singha”) đã hoàn thành đợt góp vốn đầu tiên trị giá 650 triệu USD vào công ty này.</p>
                    <p>Ký kết hợp tác chiến lược từ ngày 25/12/2015 với giao dịch trị giá 1,1 tỷ USD, cho tới hôm nay, Singha đã chuyển khoản vốn đầu tư đợt đầu với tổng 650 triệu đô la Mỹ, bao gồm 50 triệu đô la Mỹ để sở hữu 33,3% cổ phần Masan Brewery và 600 triệu ");
                WriteLiteral(@"đô la Mỹ để sở hữu 14,3% cổ phần Masan Consumer Holdings.</p>
